import { __decorate } from "tslib";
import { Component } from '@angular/core';
let ShoppingCartComponent = class ShoppingCartComponent {
    constructor(shoppingCartService) {
        this.items = [];
        this.totalPrice = 0;
        this.shoppingCartService = shoppingCartService;
    }
    async ngOnInit() {
        this.items = await this.shoppingCartService.getBeersFromApi();
        for (let i = 0; i < this.items.length; i++) {
            this.items[i].in_cart = true;
            if (this.items[i].price !== undefined) {
                this.totalPrice += this.items[i].price;
            }
        }
        console.log(this.totalPrice);
    }
};
ShoppingCartComponent = __decorate([
    Component({
        selector: 'app-shopping-cart',
        templateUrl: './shopping-cart.component.html',
        styleUrls: ['./shopping-cart.component.scss']
    })
], ShoppingCartComponent);
export { ShoppingCartComponent };
